import React, { Component } from 'react';
import { withRouter } from 'react-router';
import { connect } from 'react-redux';
import { bindActionCreators, compose } from 'redux';
import { finishOnboard } from 'store/actions/main_actions';
import {
  firestoreConnect,
  firebaseConnect,
  populate,
} from 'react-redux-firebase';
import PageHomeLayout from './layout';
import { isLoaded, isEmpty } from 'react-redux-firebase';
import Loading from 'components/Loading';
import './styles.scss';

class PageHome extends Component {
  componentDidMount() {
    document.body.style.background = 'white';
  }

  render() {
    return <PageHomeLayout {...this.props} />;
  }
}

const mapStateToProps = (state, props) => {
  return {
    responses: state.firebase.ordered.responses,
    survey: state.firebase.data.survey,
  };
};

function mapDispatchToProps(dispatch) {
  return bindActionCreators({}, dispatch);
}

export default compose(
  withRouter,
  firebaseConnect(props => [
    {
      path: '/surveys/' + props.survey,
      storeAs: 'survey',
    },
    {
      path: '/responses/' + props.survey + '/' + props.uid,
      storeAs: 'responses',
    },
  ]),
  // firestoreConnect(),
  connect(mapStateToProps, mapDispatchToProps),
)(PageHome);
